(4, 'Cabbages', 'cabbages', 'Chemical Warfare in the Cabbage Patch: Exploring plant-insect interactions mediated by variation in plant defence chemistry', 'Exploring the maintenance of diversity in ecologically important plant defence traits', 'My project takes a holistic, multifaceted approach in order to investigate interactions between brassica plant defence chemistry and associated insect herbivores at different scales. Using a combination of sophisticated, state of the art molecular tools, such as metabolomics, we seek to describe the highly variable defence phenotype of wild brassica plants in multiple populations in the UK. By coupling this information with insect survey data, we look for correlations between plant defence traits and insect abundance in order to inform common garden and field experiments. In these experiments, we manipulate herbivore infestation and measure insect survival and performance on various plant phenotypes. Furthermore, we have begun to explore the mechanisms by which specialist herbivores are able to utilize, and exploit aspects of the defence chemistry of their host plants, and the consequences of these adaptations to host plant selection. ', '<p>My project takes a holistic, multifaceted approach in order to investigate interactions between brassica plant defence chemistry and associated insect herbivores at different scales. Using a combination of sophisticated, state of the art molecular tools, such as metabolomics, we seek to describe the highly variable defence phenotype of wild brassica plants in multiple populations in the UK. By coupling this information with insect survey data, we look for correlations between plant defence traits and insect abundance in order to inform common garden and field experiments. In these experiments, we manipulate herbivore infestation and measure insect survival and performance on various plant phenotypes. Furthermore, we have begun to explore the mechanisms by which specialist herbivores are able to utilize, and exploit aspects of the defence chemistry of their host plants, and the consequences of these adaptations to host plant selection. </p>', '', '@spand_ex', 'spand_ex', '', '2015-04-21 12:05:56', NULL, NULL, 0, NULL, 0);
