(5, 'Stocking Review', 'lobstockreview', 'European lobster stocking requires comprehensive impact assessment to determine fishery benefits.', 'A review of what we''ve learned and what we still need to learn about the economic and ecological suitability of hatchery stocking as a method of conserving and enhancing wild lobster populations.  ', 'Historically, hatcheries in Europe and North America attempted to contribute to the conservation and enhancement of clawed lobster stocks, but\r\nlacked monitoring programmes capable of assessing success. In the 1990s, this perspective was changed by the results of restocking and stock\r\nenhancement experiments that inserted microwire tags into hatchery-reared juvenile European lobsters (Homarus gammarus) before release.\r\nThis allowed recapture in sufficient numbers to prove that lobsters had survived and recruited to the mature fishable stock. However, evidence\r\nof recruitment still failed to answer key questions about the ultimate ecological and economic benefits. As a result, a growing number of\r\nlobster stocking ventures remain hindered by a lack of clear evidence of the effects of their stocking schemes. This review evaluates these experiments\r\nand related studies on other fished species, summarizes key findings, and identifies data and knowledge gaps. Although studies of fitness in\r\ncultured lobsters provide some of the most encouraging results from the wider field of hatchery-based stocking, the limitations of physical tagging\r\ntechnology have significantly hindered appraisals of stocking impacts. We lack basic knowledge of lobster ecology and population dynamics,\r\nespecially among prerecruits, and of the impact of stocking on wild lobster population genetics. We advocate the use of genetic methods to\r\nfurther our understanding of population structure, rearing processes, and stocking success. We also recommend that more focused and comprehensive\r\nimpact assessments are required to provide a robust endorsement or rejection of stocking as a viable tool for the sustainable management\r\nof lobster fisheries.', '<p>Historically, hatcheries in Europe and North America attempted to contribute to the conservation and enhancement of clawed lobster stocks, but\nlacked monitoring programmes capable of assessing success. In the 1990s, this perspective was changed by the results of restocking and stock\nenhancement experiments that inserted microwire tags into hatchery-reared juvenile European lobsters (Homarus gammarus) before release.\nThis allowed recapture in sufficient numbers to prove that lobsters had survived and recruited to the mature fishable stock. However, evidence\nof recruitment still failed to answer key questions about the ultimate ecological and economic benefits. As a result, a growing number of\nlobster stocking ventures remain hindered by a lack of clear evidence of the effects of their stocking schemes. This review evaluates these experiments\nand related studies on other fished species, summarizes key findings, and identifies data and knowledge gaps. Although studies of fitness in\ncultured lobsters provide some of the most encouraging results from the wider field of hatchery-based stocking, the limitations of physical tagging\ntechnology have significantly hindered appraisals of stocking impacts. We lack basic knowledge of lobster ecology and population dynamics,\nespecially among prerecruits, and of the impact of stocking on wild lobster population genetics. We advocate the use of genetic methods to\nfurther our understanding of population structure, rearing processes, and stocking success. We also recommend that more focused and comprehensive\nimpact assessments are required to provide a robust endorsement or rejection of stocking as a viable tool for the sustainable management\nof lobster fisheries.</p>', 'www.icesjms.oxfordjournals.org', NULL, NULL, '2015-01-26 18:29:04', NULL, NULL, NULL, NULL, 'Ellis, C. D., Hodgson, D. J., Daniels, C. L., Boothroyd, D. P., Bannister, R. C. A., and Griffiths, A. G. F. European lobster stocking requires comprehensive impact assessment to determine fishery benefits.  ICES Journal of Marine Science, doi: 10.1093/ icesjms/fsu196.', 0),
(6, 'Badgers', 'badgers', 'Mortality trajectory analysis reveals the drivers of sex-specific epidemiology in natural wildlife-disease interactions', '', 'In animal populations, males are commonly more susceptible to disease-induced mortality than females. However, three competing mechanisms can cause this sex bias: weak males may simultaneously be more prone to exposure to infection and mortality; being male may be an imperfect proxy for the underlying driver of disease-induced mortality; or males may experience increased severity of disease-induced effects compared with females. Here, we infer the drivers of sex-specific epidemiology by decomposing fixed mortality rates into mortality trajectories and comparing their parameters. We applied Bayesian survival trajectory analysis to a 22-year longitudinal study of a population of badgers (Meles meles) naturally infected with bovine tuberculosis (bTB). At the point of infection, infected male and female badgers had equal mortality risk, refuting the hypothesis that acquisition of infection occurs in males with coincidentally high mortality. Males and females exhibited similar levels of heterogeneity in mortality risk, refuting the hypothesis that maleness is only a proxy for disease susceptibility. Instead, sex differences were caused by a more rapid increase in male mortality rates following infection. Males are indeed more susceptible to bTB, probably due to immunological differences between the sexes. We recommend this mortality trajectory approach for the study of infection in animal populations.', '<p>In animal populations, males are commonly more susceptible to disease-induced mortality than females. However, three competing mechanisms can cause this sex bias: weak males may simultaneously be more prone to exposure to infection and mortality; being male may be an imperfect proxy for the underlying driver of disease-induced mortality; or males may experience increased severity of disease-induced effects compared with females. Here, we infer the drivers of sex-specific epidemiology by decomposing fixed mortality rates into mortality trajectories and comparing their parameters. We applied Bayesian survival trajectory analysis to a 22-year longitudinal study of a population of badgers (Meles meles) naturally infected with bovine tuberculosis (bTB). At the point of infection, infected male and female badgers had equal mortality risk, refuting the hypothesis that acquisition of infection occurs in males with coincidentally high mortality. Males and females exhibited similar levels of heterogeneity in mortality risk, refuting the hypothesis that maleness is only a proxy for disease susceptibility. Instead, sex differences were caused by a more rapid increase in male mortality rates following infection. Males are indeed more susceptible to bTB, probably due to immunological differences between the sexes. We recommend this mortality trajectory approach for the study of infection in animal populations.</p>', 'http://rspb.royalsocietypublishing.org/content/281/1790/20140526', NULL, NULL, '2015-04-21 11:24:53', NULL, NULL, NULL, NULL, 'McDonald, J. L., Smith, G. C., McDonald, R. A., Delahay, R. J., & Hodgson, D. (2014). Mortality trajectory analysis reveals the drivers of sex-specific epidemiology in natural wildlifedisease interactions. Proceedings of the Royal Society of London B: Biological Sciences, 281(1790), 20140526.', 0),
(7, 'Lobster fecundity', 'lobstereggs', 'Geographic and environmental drivers of fecundity in the European lobster (Homarus gammarus)', '', 'Fecundity in the European lobster (Homarus gammarus) has been shown to exhibit extensive spatial variation across northern Europe. Previously,\r\nthis has been attributed to a lack of methodological standardization among samples. Instead, we show significant correlations between fecundity\r\nand both geographical and environmental drivers. We use linear mixed-effect models to assess the contribution of latitude, longitude, and measures\r\nof sea surface temperatures on the sizefecundity relationships of 1058 ovigerous females from 11 locations in the UK, Ireland, and Norway. We\r\ninclude new data for 52 lobsters from Falmouth, UK, the southwest limit of existing samples. Fecundity at mean female size correlated positively with\r\neastings and greater annual ranges in sea surface temperature, but not with mean temperature or latitude. This contradicts the established latitudinal\r\nand mean temperature dependence reported for the closely related H. americanus. We postulate that proximity to stable Atlantic currents\r\nis the most likely driver of the relationship between fecundity and longitude. Mechanisms are discussed by which egg production or retention may\r\nbe influenced by temperature range rather than by mean temperature. With further validation, we propose that temperature-correlated fecundity\r\npredictions will provide a valuable tool in ensuring that management thresholds are appropriate for the reproductive characteristics of lobster\r\npopulations.', '<p>Fecundity in the European lobster (Homarus gammarus) has been shown to exhibit extensive spatial variation across northern Europe. Previously,\nthis has been attributed to a lack of methodological standardization among samples. Instead, we show significant correlations between fecundity\nand both geographical and environmental drivers. We use linear mixed-effect models to assess the contribution of latitude, longitude, and measures\nof sea surface temperatures on the sizefecundity relationships of 1058 ovigerous females from 11 locations in the UK, Ireland, and Norway. We\ninclude new data for 52 lobsters from Falmouth, UK, the southwest limit of existing samples. Fecundity at mean female size correlated positively with\neastings and greater annual ranges in sea surface temperature, but not with mean temperature or latitude. This contradicts the established latitudinal\nand mean temperature dependence reported for the closely related H. americanus. We postulate that proximity to stable Atlantic currents\nis the most likely driver of the relationship between fecundity and longitude. Mechanisms are discussed by which egg production or retention may\nbe influenced by temperature range rather than by mean temperature. With further validation, we propose that temperature-correlated fecundity\npredictions will provide a valuable tool in ensuring that management thresholds are appropriate for the reproductive characteristics of lobster\npopulations.</p>', 'http://icesjms.oxfordjournals.org/content/early/2015/03/17/icesjms.fsv044.full.pdf+html', NULL, NULL, '2015-04-21 11:27:33', NULL, NULL, NULL, NULL, 'Ellis, C. D., Knott, H., Daniels, C. L., Witt, M. J., and Hodgson, D. J. Geographic and environmental drivers of fecundity in the European lobster (Homarus gammarus). ICES Journal of Marine Science, doi: 10.1093/icesjms/fsv044.', 0),
(8, 'Badgers2', 'morebadgers', 'Badger social networks correlate with tuberculosis infection', 'Quick synopsis of project, summed up in around 100 words for quick reference', 'Although disease hosts are classically assumed to interact randomly [1], infection is likely to spread across structured and dynamic contact networks [2]. We used social network analyses to investigate contact patterns of group-living European badgers, Meles meles, which are an important wildlife reservoir of bovine tuberculosis (TB). We found that TB test-positive badgers were socially isolated from their own groups but were more important for flow, potentially of infection, between social groups. The distinctive social position of infected badgers may help explain how social stability mitigates, and social perturbation increases, the spread of infection in badgers.', '<p>Although disease hosts are classically assumed to interact randomly [1], infection is likely to spread across structured and dynamic contact networks [2]. We used social network analyses to investigate contact patterns of group-living European badgers, Meles meles, which are an important wildlife reservoir of bovine tuberculosis (TB). We found that TB test-positive badgers were socially isolated from their own groups but were more important for flow, potentially of infection, between social groups. The distinctive social position of infected badgers may help explain how social stability mitigates, and social perturbation increases, the spread of infection in badgers.</p>', 'http://www.sciencedirect.com/science/article/pii/S0960982213011238', NULL, NULL, '2015-04-21 11:42:59', NULL, NULL, NULL, NULL, 'Weber, N., Carter, S. P., Dall, S. R., Delahay, R. J., McDonald, J. L., Bearhop, S., & McDonald, R. A. (2013). Badger social networks correlate with tuberculosis infection. Current Biology, 23(20), R915-R916.', 0),
(9, 'multi-state badgers ', 'evenmorebadgers', 'Multi-state modelling reveals sex-dependent transmission, progression and severity of tuberculosis in wild badgers', '', 'Statistical models of epidemiology in wildlife populations usually consider diseased individuals as a single class, despite knowledge that infections progress through states of severity. Bovine tuberculosis (bTB) is a serious zoonotic disease threatening the UK livestock industry, but we have limited understanding of key epidemiological processes in its wildlife reservoirs. We estimated differential survival, force of infection and progression in disease states in a population of Eurasian badgers (<em>Meles meles</em>), naturally infected with bTB. Our state-dependent models overturn prevailing categorizations of badger disease states, and find novel evidence for early onset of disease-induced mortality in male but not female badgers. Males also have higher risk of infection and more rapid disease progression which, coupled with state-dependent increases in mortality, could promote sex biases in the risk of transmission to cattle. Our results reveal hidden complexities in wildlife disease epidemiology, with implications for the management of TB and other zoonotic diseases.', '<p>Statistical models of epidemiology in wildlife populations usually consider diseased individuals as a single class, despite knowledge that infections progress through states of severity. Bovine tuberculosis (bTB) is a serious zoonotic disease threatening the UK livestock industry, but we have limited understanding of key epidemiological processes in its wildlife reservoirs. We estimated differential survival, force of infection and progression in disease states in a population of Eurasian badgers (<em>Meles meles</em>), naturally infected with bTB. Our state-dependent models overturn prevailing categorizations of badger disease states, and find novel evidence for early onset of disease-induced mortality in male but not female badgers. Males also have higher risk of infection and more rapid disease progression which, coupled with state-dependent increases in mortality, could promote sex biases in the risk of transmission to cattle. Our results reveal hidden complexities in wildlife disease epidemiology, with implications for the management of TB and other zoonotic diseases.</p>', 'http://journals.cambridge.org/action/displayAbstract?fromPage=online&aid=8933012&fileId=S0950268812003019', NULL, NULL, '2015-04-21 11:46:50', NULL, NULL, NULL, NULL, 'Graham, J., Smith, G. C., Delahay, R. J., Bailey, T., McDonald, R. A., & Hodgson, D. (2013). Multi-state modelling reveals sex-dependent transmission, progression and severity of tuberculosis in wild badgers. Epidemiology and infection, 141(07), 1429-1436.', 0);
