(1, 'f.sargent@exeter.ac.uk', 'francesca', 2, 'pbkdf2:sha1:1000$LdOcEZqe$49505cd5ad06198c61d0ef84e8e1981aa8e0bf88', 1, 'Francesca Sargent', 'Falmouth, Cornwall', '', '', '', '', 'Computing Development Officer', '2015-01-16 11:41:05', '2015-04-23 09:57:06', '966f533ba6bce3a0384b14a14a6324ce', 'f.sargent@exeter.ac.uk', 'http://chez.io', '@bellachezella', 'bellachezella', 'https://www.linkedin.com/pub/francesca-sargent/b0/95b/759', 'https://plus.google.com/u/0/101643196957978387971', 1, '555425996204429312'),
(2, 'j.mcdonald@exeter.ac.uk', 'j.mcdonald', 1, 'pbkdf2:sha1:1000$5yqsaASW$f08605a672dd6e48a131d37f052c6fc2639af7d6', 1, 'Dr Jenni McDonald', 'College of Life and Environmental Science, University of Exeter', 'I am an ecologist interested in how quantitative tools can be used to address key questions. My current research focuses on how organisms have evolved to buffer their life history traits, with demographic resilience considered an important mechanism for species to cope in unpredictable environments. This research aims to shed light on the robustness of the demographic buffering hypothesis. Previously, I completed my PhD which focussed on the disease and population dynamics of a wild badger population naturally infected with bovine tuberculosis. As part of this project I used mixed-effects multi-state models to explore disease transmission and progression rates, Bayesian survival trajectory analyses (BaSTA) to identify the underlying cause of sex-differences in disease response and integrated population models to map population dynamics.', '<p>I am an ecologist interested in how quantitative tools can be used to address key questions. My current research focuses on how organisms have evolved to buffer their life history traits, with demographic resilience considered an important mechanism for species to cope in unpredictable environments. This research aims to shed light on the robustness of the demographic buffering hypothesis. Previously, I completed my PhD which focussed on the disease and population dynamics of a wild badger population naturally infected with bovine tuberculosis. As part of this project I used mixed-effects multi-state models to explore disease transmission and progression rates, Bayesian survival trajectory analyses (BaSTA) to identify the underlying cause of sex-differences in disease response and integrated population models to map population dynamics.</p>', '2008 BSc (Hons) Zoology (1st) Reading University<br/>\r\n2010 MSc Conservation and Biodiversity (Distinction) University of Exeter<br/>\r\n2014 PhD Biological Science University of Exeter<br/>', '<p>I am an ecologist interested in how quantitative tools can be used to address key questions. My current research focuses on how organisms have evolved to buffer their life history traits, with demographic resilience considered an important mechanism for species to cope in unpredictable environments. This research aims to shed light on the robustness of the demographic buffering hypothesis. Previously, I completed my PhD which focussed on the disease and population dynamics of a wild badger population naturally infected with bovine tuberculosis. As part of this project I used mixed-effects multi-state models to explore disease transmission and progression rates, Bayesian survival trajectory analyses (BaSTA) to identify the underlying cause of sex-differences in disease response and integrated population models to map population dynamics.</p>', 'Associate Research Fellow', '2015-01-16 12:21:20', '2015-04-21 17:17:48', 'cf66e2796e037ae4e26f0c6fa73b34bb', 'j.mcdonald@exeter.ac.uk', '', '@JL_McD', 'JL_McD', 'https://uk.linkedin.com/pub/jenni-mcdonald/7b/325/904', 'https://scholar.google.co.uk/citations?user=-Kwpi-cAAAAJ&hl=en&oi=sra', 1, '555428497418891265'),
(3, 'spandex.ex@gmail.com', 'test', 1, 'pbkdf2:sha1:1000$1m0MZfKI$4f719f9e21d1aa60e25ecb01ec99bb625491aac8', 1, 'Example User', 'Falmouth, Cornwall', '<h3>Header Example</h3>\r\n\r\nExample text. Followed by an example list; \r\n<ul>\r\n<li>List item one</li>\r\n<li>List item two</li>\r\n</ul>\r\n\r\nHere is something someone said once,\r\n\r\n<blockquote>\r\nI quoted this as a quote and it was very quotable\r\n</blockquote>\r\n\r\n<em>Italics</em>\r\n<pre>Example code or file content in a seperate box</pre>\r\n<b>Bold</b>\r\n\r\n<code>Some more example code, inline, but could be used for anything</code>, and you can also <mark>highlight the text you find important.</mark>', '<h3>Header Example</h3>\n\n<p>Example text. Followed by an example list; \n</p><ul>\n<li>List item one</li>\n<li>List item two</li>\n</ul><p></p>\n<p>Here is something someone said once,</p>\n<blockquote>\nI quoted this as a quote and it was very quotable\n</blockquote>\n\n<p><em>Italics</em>\n</p><pre>Example code or file content in a seperate box</pre>\n<b>Bold</b><p></p>\n<p><code>Some more example code, inline, but could be used for anything</code>, and you can also &lt;mark&gt;highlight the text you find important.&lt;/mark&gt;</p>', '', '<h3>Header Example</h3>\n\n<p>Example text. Followed by an example list; \n</p><ul>\n<li>List item one</li>\n<li>List item two</li>\n</ul><p></p>\n<p>Here is something someone said once,</p>\n<blockquote>\nI quoted this as a quote and it was very quotable\n</blockquote>\n\n<p><em>Italics</em>\n</p><pre>Example code or file content in a seperate box</pre>\n<b>Bold</b><p></p>\n<p><code>Some more example code, inline, but could be used for anything</code>, and you can also &lt;mark&gt;highlight the text you find important.&lt;/mark&gt;</p>', 'Example Job Title', '2015-01-16 13:27:12', '2015-01-16 13:38:39', '740442fc6e1eb534aed8039ca97b7895', 'spandex.ex@exeter.ac.uk', '', '@spand_ex', 'spand_ex', '', '', 0, ''),
(4, 'a.h.bates@exeter.ac.uk', 'a.h.bates', 1, 'pbkdf2:sha1:1000$rEF8rweN$d4dd059a3ebfc9f30a520d317af70d493dfda74a', 1, 'Adam Bates', NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-26 12:15:05', '2015-04-23 11:52:07', '1d11525e978b05f1085c99085bf279b5', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL),
(5, 'cde204@exeter.ac.uk', 'cde204', 1, 'pbkdf2:sha1:1000$bCboHon4$b5b3c6f6083e3e2255739c0046b67af89d0d0b50', 1, 'Charlie Ellis', 'ESI, Penryn Campus', 'Having grown up in coastal North Cornwall, I became interested in creating sustainable ways to meet seafood demand, and the conservation of both traditional inshore fishing fleets and the populations they target. My PhD focuses on the population ecology of European lobsters in Cornwall and the Isles of Scilly, and on the stock enhancement project run to conserve this important species by the National Lobster Hatchery ( www.nationallobsterhatchery.co.uk ). This project aims to use genetic markers to test population structure and reproductive ecology in local lobsters, and provide lobster hatcheries and alternative stock conservation measures with a genetic method to identify released animals, enabling assessments of how well they contribute to the sustainability of pressured or depleted marine populations.', '<p>Having grown up in coastal North Cornwall, I became interested in creating sustainable ways to meet seafood demand, and the conservation of both traditional inshore fishing fleets and the populations they target. My PhD focuses on the population ecology of European lobsters in Cornwall and the Isles of Scilly, and on the stock enhancement project run to conserve this important species by the National Lobster Hatchery ( <a href="http://www.nationallobsterhatchery.co.uk" rel="nofollow">www.nationallobsterhatchery.co.uk</a> ). This project aims to use genetic markers to test population structure and reproductive ecology in local lobsters, and provide lobster hatcheries and alternative stock conservation measures with a genetic method to identify released animals, enabling assessments of how well they contribute to the sustainability of pressured or depleted marine populations.</p>', '2006 BSc Marine Biology and Oceanography (University of Plymouth)', '<p>Having grown up in coastal North Cornwall, I became interested in creating sustainable ways to meet seafood demand, and the conservation of both traditional inshore fishing fleets and the populations they target. My PhD focuses on the population ecology of European lobsters in Cornwall and the Isles of Scilly, and on the stock enhancement project run to conserve this important species by the National Lobster Hatchery ( <a href="http://www.nationallobsterhatchery.co.uk" rel="nofollow">www.nationallobsterhatchery.co.uk</a> ). This project aims to use genetic markers to test population structure and reproductive ecology in local lobsters, and provide lobster hatcheries and alternative stock conservation measures with a genetic method to identify released animals, enabling assessments of how well they contribute to the sustainability of pressured or depleted marine populations.</p>', 'PhD Researcher', '2015-01-26 17:48:01', '2015-04-21 12:15:08', '349c571b95f4f55e418d1aae3106b2e9', 'cde204@exeter.ac.uk', '', '@crabsandcricket', 'crabsandcricket', '', '', 1, '562210538327773184'),
(6, 'd.j.hodgson@exeter.ac.uk', 'DaveHodgson', 1, 'pbkdf2:sha1:1000$UIPTL3zS$765452d1f902a7ed96658dcb9e7ad0542bc9dd99', 1, 'Dave Hodgson', 'Centre for Ecology and Conservation', 'A quantitative ecologist, working at the interface of evolution, ecology, demography, life history, mathematics and statistics. Interested in BIG questions, BETTER tools, and BROADER understanding for ecological systems.', '<p>A quantitative ecologist, working at the interface of evolution, ecology, demography, life history, mathematics and statistics. Interested in BIG questions, BETTER tools, and BROADER understanding for ecological systems.</p>', 'BSc (Hons) Ecology and Statistics, Massey University New Zealand;\r\nPhD in Evolutionary Ecology, Imperial College at Silwood Park;\r\nPostdoctoral research at Centre for Ecology and Hydrology, Oxford;\r\nLectureship at University of Exeter, Streatham Campus;\r\nAssociate Professor at University of Exeter, Penryn Campus;\r\nHonorary Secretary of the British Ecological Society', '<p>A quantitative ecologist, working at the interface of evolution, ecology, demography, life history, mathematics and statistics. Interested in BIG questions, BETTER tools, and BROADER understanding for ecological systems.</p>', 'Associate Professor of Ecology', '2015-02-06 13:15:50', '2015-04-13 11:00:35', '1de7d82ab1a704d328a65ebf67834d00', 'd.j.hodgson@exeter.ac.uk', 'http://biosciences.exeter.ac.uk/staff/index.php?we', '@DaveHodgson00', 'DaveHodgson00', '', 'http://scholar.google.co.uk/citations?user=r2lDw6QAAAAJ&hl=en', 1, '563691253725147136'),
(7, 'ar364@exeter.ac.uk', 'Adamrogers', 1, 'pbkdf2:sha1:1000$OTlebcaL$5d6d01a0209dd6c42ccb0b052a3f04b1f48c017c', 1, 'Adam Rogers', 'Exeter university - Penryn Campus', 'MbyRes student investigating dispersal behaviour in the common garden snail (Cornu aspersum)', '<p>MbyRes student investigating dispersal behaviour in the common garden snail (Cornu aspersum)</p>', 'BSc Zoology (Hons) - Exeter university', '<p>MbyRes student investigating dispersal behaviour in the common garden snail (Cornu aspersum)</p>', 'MbyRes Student', '2015-04-21 11:11:14', '2015-04-21 11:40:17', 'fd3454008a90a57869ec59964b0e4939', 'ar364@exeter.ac.uk', '', '@AdamTheVetUK', 'AdamTheVetUK', 'https://uk.linkedin.com/in/adamrogers4', '', 1, '590483579521597440'),
(8, 'nag204@exeter.ac.uk', 'nag204', 1, 'pbkdf2:sha1:1000$0iiJSRlg$af216b6c1331c58083d6fa743e4ffdc03ef8e973', 1, 'Nicole Ann Goodey', 'University of Exeter, Penryn Campus, Cornwall, UK', 'Phytophagous insects are confronted with an arsenal of plant secondary metabolites, which comprise highly toxic chemical compounds. Whilst some herbivore species are effectively deterred by the expression of such toxins, other species have evolved to specialize on host plant chemistry. The differential selection pressure imposed on plant is considered to be responsible for the stunning diversity we observe in plant secondary metabolites. I am interested in exploring the biochemical arms race between plants and their insect herbivores, and I use wild cabbage and its associated insect community to answer fundamental ecological questions.\r\n\r\n', '<p>Phytophagous insects are confronted with an arsenal of plant secondary metabolites, which comprise highly toxic chemical compounds. Whilst some herbivore species are effectively deterred by the expression of such toxins, other species have evolved to specialize on host plant chemistry. The differential selection pressure imposed on plant is considered to be responsible for the stunning diversity we observe in plant secondary metabolites. I am interested in exploring the biochemical arms race between plants and their insect herbivores, and I use wild cabbage and its associated insect community to answer fundamental ecological questions.</p>', '1st class Bsc: Conservation Biology and Ecology, University of Exeter', '<p>Phytophagous insects are confronted with an arsenal of plant secondary metabolites, which comprise highly toxic chemical compounds. Whilst some herbivore species are effectively deterred by the expression of such toxins, other species have evolved to specialize on host plant chemistry. The differential selection pressure imposed on plant is considered to be responsible for the stunning diversity we observe in plant secondary metabolites. I am interested in exploring the biochemical arms race between plants and their insect herbivores, and I use wild cabbage and its associated insect community to answer fundamental ecological questions.</p>', 'PhD: The evolutionary ecology of plant insect interactions mediated by plant defence chemistry', '2015-04-21 11:11:42', '2015-04-21 12:06:46', 'f33247bc0cdb8fcf6ce0566c002465b4', '', '', '@Cabbgegirl', 'Cabbgegirl', '', '', 0, NULL);
